import Questionlist from './QuestionList';
import {useHistory} from 'react-router-dom';

function Homepage() {
const history=useHistory();

  return (
    <Container >
  
      <Nav />
      <Section />
      <Qa />
      <Profile />
      <Questionlist />
    </Container>
    

  );
}

export default Homepage;

const Container = styled.div`
position: absolute;
width: 100%;
height: 100%;
min-height: 900px;
background-repeat: no-repeat;
background-size: cover;

`;
